import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <body>
      <header>
        <h2 className="logo">Logo</h2>
        <nav className="navigation">
          <a href="#" className="button active">
            Home
          </a>
          <a href="#" className="button ">
            About
          </a>
          <a href="#" className="button ">
            Service
          </a>
          <a href="#" className="button ">
            Contact
          </a>
        </nav>
      </header>
    </body>
  );
}

export default App;
